import React, {Component} from 'react';



import {Link} from 'react-router-dom';

class Home extends Component{
    render() {
        return(
            <div>
                This is the homepage. Click <Link to={'dev/products'}>here</Link> to go to the products page
            </div>
        );
    }
}

export default Home;
